import './App.css';
import {Route, Link, Switch} from 'react-router-dom';
import Home from './Home'
import CreateNewP from './CreateNewP'
import EditP from './EditP'

function App() {
  return (

    <div>
      <nav className="navbar bg-dark navbar-light">
        <div class="navitem">Home</div>
      </nav>

      <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route path="/creteProp" component={CreateNewP}></Route>
        <Route path="/editProp" component={EditP}></Route>
      </Switch>

    </div>
  );
}

export default App;
